@import "tailwindcss";

:root {
  color-scheme: light;
}

@media (prefers-color-scheme: dark) {
  :root {
    color-scheme: dark;
  }
}

body {
  min-height: 100vh;
  background: #f4f4f5;
  color: #18181b;
  font-family: var(--font-geist-sans), system-ui, -apple-system, BlinkMacSystemFont, "Segoe UI", sans-serif;
}

.dark body {
  background: #09090b;
  color: #f4f4f5;
}
